def minimum_tickets_to_reach_contribution(n, prices, x, a, y, b, k):
    prices.sort(reverse=True)
    cumulative_sum = [0]
    for price in prices:
        cumulative_sum.append(cumulative_sum[-1] + price)
    if x <= y:
        (x, y) = (y, x)
        (a, b) = (b, a)
    nab = 0
    na = 0
    nb = 0
    ans = -1
    for i in range(1, n + 1):
        if i % a != 0 and i % b != 0:
            continue
        if i % a == 0 and i % b == 0:
            nab += 1
        if i % a == 0 and i % b != 0:
            na += 1
        if i % a != 0 and i % b == 0:
            nb += 1
        current_contribution = (cumulative_sum[nab] * (x + y) + (cumulative_sum[nab + na] - cumulative_sum[nab]) * x + (cumulative_sum[nab + na + nb] - cumulative_sum[nab + na]) * y) // 100
        if current_contribution >= k:
            ans = i
            break
    return ans

